class Solution:
    def canMakeSubsequence(self, str1: str, str2: str) -> bool:
        def nextChar(c: str):
            return chr((ord(c) - 96) % 26 + 97)

        def match(a: str, b: str):
            return a == b or nextChar(a) == b

        i, j = 0, 0
        while i < len(str1) and j < len(str2):
            if match(str1[i], str2[j]):
                j += 1
            i += 1

        return j == len(str2)


assert Solution().canMakeSubsequence('abc', 'ad') == True, \
    f'Expected: True, Received: {Solution().canMakeSubsequence('abc', 'ad')}'
assert Solution().canMakeSubsequence('zc', 'ad') == True, \
    f'Expected: True, Received: {Solution().canMakeSubsequence('zc', 'ad')}'
assert Solution().canMakeSubsequence('ab', 'd') == False, \
    f'Expected: False, Received: {Solution().canMakeSubsequence('ab', 'd')}'
Solution().canMakeSubsequence("a", "d")
Solution().canMakeSubsequence("b", "c")
Solution().canMakeSubsequence("du", "ed")
Solution().canMakeSubsequence("om", "nm")
Solution().canMakeSubsequence("nbksekflejzgzhusd", "osellfjzgais")
